import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Results.css';

const Results = () => {
    const navigate = useNavigate();
    const [results, setResults] = useState(null);

    useEffect(() => {
        const storedResults = localStorage.getItem('prediction');
        if (storedResults) {
            setResults(JSON.parse(storedResults));
        } else {
            navigate('/');
        }
    }, [navigate]);

    // Get solutions based on calculated levels
    const solutions = getSolutions(results?.stressLevel, results?.anxietyLevel, results?.depressionLevel);

    return (
        <div className="results-container">
            <div className="results-card">
                <h2>Your Mental Health Results</h2>
                {results ? (
                    <div className="results-content">
                        <div className="result-item">
                            <span className="result-label">Stress Level:</span>
                            <span className="result-value">{results.stressLevel}</span>
                        </div>
                        <div className="result-item">
                            <span className="result-label">Anxiety Level:</span>
                            <span className="result-value">{results.anxietyLevel}</span>
                        </div>
                        <div className="result-item">
                            <span className="result-label">Depression Level:</span>
                            <span className="result-value">{results.depressionLevel}</span>
                        </div>

                        <h3>Suggested Solutions:</h3>
                        <div className="result-item">
                            <span className="result-label">Stress Solution:</span>
                            <span className="result-value">{solutions.stressSolution}</span>
                        </div>
                        <div className="result-item">
                            <span className="result-label">Anxiety Solution:</span>
                            <span className="result-value">{solutions.anxietySolution}</span>
                        </div>
                        <div className="result-item">
                            <span className="result-label">Depression Solution:</span>
                            <span className="result-value">{solutions.depressionSolution}</span>
                        </div>
                    </div>
                ) : (
                    <p>Loading results...</p>
                )}
            </div>
        </div>
    );
};


export default Results;
